import { initializeApp } from "firebase/app";
import { getAuth } from "firebase/auth";
import { getFirestore } from "firebase/firestore";

const firebaseConfig = {
  apiKey: "AIzaSyDeGxPJNjR1X5jBHxl08KWHuMInVG3f240",
  authDomain: "healthcare-site-d09bd.firebaseapp.com",
  projectId: "healthcare-site-d09bd",
  storageBucket: "healthcare-site-d09bd.appspot.com",
  messagingSenderId: "1056895388026",
  appId: "1:1056895388026:web:5c182a5b807a1b50042ec3",
  measurementId: "G-82B290GSBY",
};

const app = initializeApp(firebaseConfig);
const auth = getAuth(app);
const firestore = getFirestore(app);

export { auth, firestore };
